import './Nav.css';



const Nav=() => {
  return (
    <div className='Nav'>
        <nav>
        
          <a href="#">page1</a>
          <a href="#">page2</a>
          <a href="#">page3</a>
        
        </nav>
    </div>
  );
}

export default Nav;
